(1, 1, 'First blog post, You can edit this content by selecting from the admin', 'first-blog-post', 'The first ever blog post is here. It might be a good idea to update this post with some more relevant content.', 'This is your first ever **blog post**! It might be a good idea to update this post with some more relevant content.\n\nYou can edit this content by selecting **Blog** from the administration back-end menu.\n\n*Enjoy the good times!*', '<p>This is your first ever <strong>blog post</strong>! It might be a good idea to update this post with some more relevant content.</p>\n<p>You can edit this content by selecting <strong>Blog</strong> from the administration back-end menu.</p>\n<p><em>Enjoy the good times!</em></p>', '2023-09-28 16:45:46', 1, '2023-09-28 16:45:46', '2023-09-28 20:16:41', NULL),
(2, 1, 'Conheça a GDL, a nova potência logística do Espírito Santo', 'conheca-a-gdl-a-nova-potencia-logistica-do-espirito-santo', 'A Tegma Gestão Logística do Espírito Santo, que compõe uma das maiores empresas de logística do Brasil, e a Silotec, pioneira do segmento no estado do Espírito Santo, uniram-se para a criação de uma nova companhia, a GDL – Solução em Movimento.', 'A Tegma Gestão Logística do Espírito Santo, que compõe uma das maiores empresas de logística do Brasil, e a Silotec, pioneira do segmento no estado do Espírito Santo, uniram-se para a criação de uma nova companhia, a GDL – Solução em Movimento.\n\nA fusão gera mais agilidade, criatividade e eficiência para os negócios, o que garante à GDL ainda mais competitividade no mercado e enorme potencial para crescimento. “Espaço para citação da CEO Renata Campos”.\n\nA GDL está estrategicamente localizada em Cariacica, no Espírito Santo, em uma área com aproximadamente 300 mil m², e trata-se do segundo maior complexo logístico da América do Sul. A empresa atende os principais setores da economia, como tecnologia, automotivo, bens de consumo, farmacêutico, químico, entre outros, e conta com ampla cartela de clientes que têm atendimento personalizado.\n\nO fácil acesso às principais estradas, portos e aeroportos do país somado à alta tecnologia, grande capacidade de entrega e extensa experiência no segmento proporcionam à GDL excelência em solução logística e marcam o início de uma nova era.', '<p>A Tegma Gestão Logística do Espírito Santo, que compõe uma das maiores empresas de logística do Brasil, e a Silotec, pioneira do segmento no estado do Espírito Santo, uniram-se para a criação de uma nova companhia, a GDL – Solução em Movimento.</p>\n<p>A fusão gera mais agilidade, criatividade e eficiência para os negócios, o que garante à GDL ainda mais competitividade no mercado e enorme potencial para crescimento. “Espaço para citação da CEO Renata Campos”.</p>\n<p>A GDL está estrategicamente localizada em Cariacica, no Espírito Santo, em uma área com aproximadamente 300 mil m², e trata-se do segundo maior complexo logístico da América do Sul. A empresa atende os principais setores da economia, como tecnologia, automotivo, bens de consumo, farmacêutico, químico, entre outros, e conta com ampla cartela de clientes que têm atendimento personalizado.</p>\n<p>O fácil acesso às principais estradas, portos e aeroportos do país somado à alta tecnologia, grande capacidade de entrega e extensa experiência no segmento proporcionam à GDL excelência em solução logística e marcam o início de uma nova era.</p>', '2023-09-28 19:19:40', 1, '2023-09-28 19:19:44', '2023-09-28 19:19:44', NULL);

